X-lumin enables the widespread use and implementation of optical wireless communication products. We digitize, secure, and exchange data at extremely high speeds over long distances. Our aim is to bring telecommunications reliability and costs to improve CAPEX and OPEX.
Please don't hesitate to reach out if you would like to discuss any of the following;
*Optical Wireless Communications *Ground-to-Space Lasercom *Quantum Key Distribution (QKD)                         * LiDAR/ LADAR *Satellite Laser Ranging (SLR) *Space Situational Awareness
